/* Zoom + highlight from ?block=... */
(function initZoomFunctionality() {
  var map = null;
  for (var key in window) {
    if (key.startsWith('map_') && window[key] && typeof window[key].fitBounds === 'function') {
      map = window[key]; break;
    }
  }
  if (!map) { setTimeout(initZoomFunctionality, 100); return; }

  function norm(s){ return (s||"").toString().trim().toLowerCase(); }
  var blockIndex = {}, lastHiLayer=null, lastHiTimeout=null;

  function captureOrigStyle(layer){
    if (!layer || !layer.options) return null;
    return {
      color: layer.options.color,
      weight: layer.options.weight,
      opacity: layer.options.opacity,
      fillColor: layer.options.fillColor,
      fillOpacity: layer.options.fillOpacity
    };
  }
  function applyStyle(layer, style){ try{ if(layer&&layer.setStyle)layer.setStyle(style);}catch(e){} }

  function harvest(layer){
    try{
      if(layer&&layer.feature&&layer.feature.properties){
        var nm = layer.feature.properties["Block Name"] || layer.feature.properties["name"];
        if(nm && typeof layer.getBounds==='function'){
          var b = layer.getBounds();
          if(b && b.isValid && b.isValid()){
            var key=norm(nm);
            if(!blockIndex[key]){
              blockIndex[key]={bounds:b,layer:layer,origStyle:captureOrigStyle(layer)};
            }
          }
        }
      }
      if(layer&&layer.eachLayer)layer.eachLayer(harvest);
    }catch(e){}
  }

  function rebuildIndex(){ blockIndex={}; map.eachLayer(harvest); }
  setTimeout(rebuildIndex,1000);
  map.on('layeradd',()=>setTimeout(rebuildIndex,50));
  map.on('layerremove',()=>setTimeout(rebuildIndex,50));

  function highlightLayer(layer){
    if(lastHiTimeout){clearTimeout(lastHiTimeout); lastHiTimeout=null;}
    if(lastHiLayer){
      for(var k in blockIndex){
        if(blockIndex[k].layer===lastHiLayer && blockIndex[k].origStyle){
          applyStyle(lastHiLayer,blockIndex[k].origStyle); break;
        }
      }
    }
    try{
      applyStyle(layer,{color:'blue',weight:3,opacity:1});
      lastHiLayer=layer;
      lastHiTimeout=setTimeout(()=>{
        for(var k in blockIndex){
          if(blockIndex[k].layer===layer && blockIndex[k].origStyle){
            applyStyle(layer,blockIndex[k].origStyle); break;
          }
        }
        lastHiLayer=null;
      },3000);
    }catch(e){}
  }

  window.zoomToBlock=function(name){
    if(!name)return false;
    var key=norm(name), obj=blockIndex[key];
    if(!obj){ rebuildIndex(); obj=blockIndex[key]; if(!obj){console.warn("Block not found:",name); return false;} }
    map.fitBounds(obj.bounds,{padding:[40,40],animate:true});
    highlightLayer(obj.layer);
    return true;
  };

  var q=new URLSearchParams(window.location.search), blk=q.get('block');
  if(blk){ setTimeout(()=>{window.zoomToBlock(blk);},1100); }
})();
